# 给定一个非负整数数组，你最初位于数组的第一个位置。
#
#  数组中的每个元素代表你在该位置可以跳跃的最大长度。
#
#  你的目标是使用最少的跳跃次数到达数组的最后一个位置。
#
#  示例:
#
#  输入: [2,3,1,1,4]
# 输出: 2
# 解释: 跳到最后一个位置的最小跳跃数是 2。
# 从下标为 0 跳到下标为 1 的位置，跳1步，然后跳3步到达数组的最后一个位置。
#
#
#  说明:
#
#  假设你总是可以到达数组的最后一个位置。
#  Related Topics 贪心算法 数组
#  👍 754 👎 0

from typing import List

class Solution:

    def jump_my(self, nums: List[int]) -> int:
        n = len(nums)
        short_step = [0 for _ in range(n)]
        for i in range(1, n):
            min_step = None
            for j in range(0, i):
                steps = i - j
                if steps <= nums[j]:
                    _min_step = short_step[j] + 1
                    if min_step is None:
                        min_step = _min_step
                    else:
                        min_step = min(min_step, _min_step)
                else:
                    continue
            else:
                short_step[i] = min_step

        return short_step[-1]


    def jump(self, nums: List[int]) -> int:
        n = len(nums)
        maxPos, end, step = 0, 0, 0
        for i in range(n - 1):
            # if maxPos >= i:
            maxPos = max(maxPos, i + nums[i])
            if i == end:
                end = maxPos
                step += 1
        return step


